import React from "react";
import { Container, Form, Navbar } from "react-bootstrap";

function NavBar() {
  return (
    <Navbar expand="lg" className="bk">
      <Container>
        <Navbar.Brand href="#">
          <img src="logo.jpg" className="logo" alt="logo" />
        </Navbar.Brand>
        <Form className=" nav-style" style={{border: "2px solid red", boxShadow: 'none'}}>
          <Form.Control
            type="text"
            placeholder="ابحث"
            className="me-2 w-100 "
            aria-label="Search"
          />
        </Form>
      </Container>
    </Navbar>
  );
}

export default NavBar;
